<h4>
Description
</h4>
<p>Retinoic acid early transcript 1E (<a href="https://www.uniprot.org/uniprot/Q8TD07">RAET1E</a>). Binds and activates the KLRK1/NKG2D receptor, mediating natural killer cell cytotoxicity.</p>
<p><br></p>
<h4>
Clinical trials
</h4>
<p><a href="https://clinicaltrials.gov/ct2/show/NCT04107142">NCT04107142</a> - Colorectal Cancer, Prostate Cancer, Sarcoma</p>
<p><br></p>
<h4>
